import React, {useState, useEffect} from 'react'
import axios from "axios";

let url="https://api.jikan.moe/v3/deathnote";

const Home = () => {

    useEffect(async () =>
    {

            try
            {
                const res = await axios.get(url);
                console.log(res.data);
            }
            catch(err)
            {
                console.log(err);
            }



    }, [])

    return (
        <div>
            
        </div>
    )
}

export default Home;
